        <Box sx={{ textAlign: 'center', fontSize: '24px' }}>The conflict is complicated.</Box>
        <Box sx={{ fontWeight: '800', textAlign: 'center', fontSize: '24px' }}>
            Terrorism is not.
        </Box>
    </Box>
);

export default HeaderText;
